//激活函数SIGMOID
float Sigmoid(float x){
	return 1.0 / (1.0 + exp(-x));
}

//矩阵读取函数
void matrix_read(){
    FILE *fp;
    int temprows=0;
    int k;
    int countrows=0;
    fp=fopen("temp.txt","r");
    while(countrows < Rows){
        for(k=0; k<10; k++)
            if(fscanf(fp, "%f",&tempinput[countrows*InSize + k])==EOF)break;
        if(feof(fp))break;//文件读完
        countrows++;

    }
    fclose(fp);

    for(countrows=0; countrows<Rows; countrows++){
        for (k=0; k<10; k++){
            input[countrows*InSize + k]=tempinput[countrows*InSize + k+1];
        }
    }
}


//向前传播函数
void forward_propagation(){
    int i;
    int j;
    int countrows=0;
    float temp_layer_node=0.0;

    for(countrows=0; countrows<Rows; countrows++){
//input->medium1_input
        for(i=0; i<HidSize; i++){
            temp_layer_node=0.0;

            for(j=0; j<InSize; j++){
                temp_layer_node+=w1[j*HidSize+i]*input[countrows*InSize+j];
                //printf("%f \n",input[countrows*InSize+j]);
            }
            medium_input1[countrows*HidSize+i]=Sigmoid(temp_layer_node+b1[i]);
            //printf("%f \n",medium_input1[countrows*HidSize+i]);
        }

//medium1_input->medium2_input
        for(i=0; i<HidSize; i++){
            temp_layer_node=0.0;

            for(j=0; j<HidSize; j++){
                temp_layer_node+=w2[j*HidSize+i]*medium_input1[countrows*HidSize+j];
            }
            medium_input2[countrows*HidSize+i]=Sigmoid(temp_layer_node+b2[i]);
        }

//medium2_input->medium3_input
        for(i=0; i<HidSize; i++){
            temp_layer_node=0.0;

            for(j=0; j<HidSize; j++){
                temp_layer_node+=w3[j*HidSize+i]*medium_input2[countrows*HidSize+j];
            }
            medium_input3[countrows*HidSize+i]=Sigmoid(temp_layer_node+b3[i]);
            //printf("%f \n",medium_input3[countrows*HidSize+i]);
        }

//medium3_input->output
        for(i=0; i<OutSize; i++){
            temp_layer_node=0.0;

            for(j=0; j<HidSize; j++){
                temp_layer_node+=w4[j*OutSize+i]*medium_input3[countrows*HidSize+j];
            }
            output[countrows*OutSize+i]=Sigmoid(temp_layer_node+b4[i]);
            //printf("%f \n",output[countrows*OutSize+i]);
        }


   }

}




